(1897, 6, 'admin/upakaras/1', 'PUT', '127.0.0.1', '{\"name\":\"Dewa Yadnya\",\"description\":\"Upacara Dewa Yadnya merupakan pemujaan dan persembahyan sebagai wujud bakti kepada Ida Sang Hyang Widhi Wasa dan segala manifestasi-Nya.\\r\\nUpacara Dewa Yadnya umumnya dilaksanakan di Sanggah-sanggah, Pamerajan, Pura, Kayangan dan tempat suci lainnya. Upacara Dewa Yadnya ada yang dilakukan setiap hari dan ada juga yang dilakukan pada hari-hari tertentu. Contoh dari upacara Dewa Yadnya yang dilakukan setiap hari adalah puja tri sandya dan yadnya sesa. Sedangkan upacara Dewa Yadnya yang dilakukan pada hari-hari tertentu seperti Galungan, Kuningan, Saraswati, Siwaratri, Purnama dan Tilem, dan piodalan lainnya.\",\"sequence\":\"1\",\"_token\":\"SvTiqjiU73JzRmybFbbR7QvoJyY4Zc20P7KY4Ool\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/upakaras\"}', '2021-01-10 22:02:34', '2021-01-10 22:02:34'),
