(1900, 6, 'admin/upakaras/2', 'PUT', '127.0.0.1', '{\"name\":\"Manusa Yadnya\",\"description\":\"Upacara Manusa Yadnya merupakan korban suci yang bertujuan untuk memelihara hidup dan membersihkan lahir batin manusia mulai dari sejak terwujudnya jasmani di dalam kandungan sampai pada akhir hidup manusia itu.\\r\\nContoh upacara Manusa Yadnya ialah : upacara Pagedong-gedongan, upacara Bayi Lahir, upacara Kepus Puser, upacara Bayi umur 42 hari, upacara Nyambutin, upacara Satu Oton, upacara Meningkat Dewasa, Upacara Potong Gigi, Upacara Perkawinan.\",\"sequence\":\"1\",\"_token\":\"SvTiqjiU73JzRmybFbbR7QvoJyY4Zc20P7KY4Ool\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/upakaras\"}', '2021-01-10 22:14:27', '2021-01-10 22:14:27'),
