(1903, 6, 'admin/upakaras/3', 'PUT', '127.0.0.1', '{\"name\":\"Bhuta Yadnya\",\"description\":\"Upacara Bhuta Yadnya merupakan yadnya yang ditujukan kepada Bhuta Kala yang mengganggu ketentraman hidup manusia. Bagi masyarakat Hindu, Bhuta Kala ini diyakini sebagai kekuatan - kekuatan yang bersifat negatif yang sering menimbulkan gangguan serta bencana tetapi dengan Bhuta Yadnya ini maka kekuatan - kekuatan tersebut akan dapat menolong dan melindungi kehidupan manusia.\\r\\nContoh Bhuta Yadnya ialah : Tingkatan kecil ( \\\"Segehan\\\" ), Tingkatan Sedang\\/Madya (\\\"Caru\\\"), Tingkatan Besar\\/Utama (\\\"Tawur Agung Kesanga, Nyepi, Eka Dasa Rudra\\\").\",\"sequence\":\"2\",\"_token\":\"SvTiqjiU73JzRmybFbbR7QvoJyY4Zc20P7KY4Ool\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/upakaras\"}', '2021-01-10 22:27:50', '2021-01-10 22:27:50'),
