(1906, 6, 'admin/upakaras/4', 'PUT', '127.0.0.1', '{\"name\":\"Pitra Yadnya\",\"description\":\"Upakara Pitra Yadnya merupakan pemujaan dengan hati yang tulus iklas dan suci yang di tujukan kepada para pitara dan roh - roh leluhur yang telah meninggal dunia.\\r\\nContoh Pitra Yadnya ialah : Upacara Penguburan Mayat, Upacara Ngaben ( Sawa Wedana, Asti Wedana, Swast Wedana, Ngelungah, Atma Wedana ).\",\"sequence\":\"2\",\"_token\":\"SvTiqjiU73JzRmybFbbR7QvoJyY4Zc20P7KY4Ool\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/upakaras\"}', '2021-01-10 22:36:48', '2021-01-10 22:36:48'),
