(1909, 6, 'admin/upakaras/5', 'PUT', '127.0.0.1', '{\"name\":\"Rsi Yadnya\",\"description\":\"Upakara Rsi Yadnya merupakan sedekah atau punia, juga persembahan kepada para pendeta atau para pemimpin upacara keagamaan. Tujuannya adalah sebagai tanda terimakasih kedapa para pendeta karena beliau telah menyelesaikan upacara yadnya.\\r\\nContoh Rsi Yadnya ialah : Padiksan utawi Apodgala.\",\"sequence\":\"1\",\"_token\":\"SvTiqjiU73JzRmybFbbR7QvoJyY4Zc20P7KY4Ool\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/upakaras\"}', '2021-01-10 22:45:45', '2021-01-10 22:45:45'),
