INSERT INTO `bantens` (`id`, `name`, `description`, `sequence`, `origin_image`, `thumbnail_image`, `created_at`, `updated_at`, `harga`) VALUES
(5, 'Banten Pejati', '(BANTEN PEJATI)\r\nadalah nama sekelompok banten, terdiri dari : Daksina, Peras, Soda, Tipat Kelanan, Penyeneng, Segehan Cacahan.', 1, 'images/20200819103839_IMG_9938.JPG', NULL, '2020-08-18 21:22:15', '2020-08-23 19:06:40', '50000.00'),
(6, 'Banten Suci', '(BANTEN SUCI) \r\nTerdiri dari : Alasnya menggunakan Tamas, Warna jajan sasamuhannya putih dan kuning.', 2, 'images/20200819105447_IMG_9977.JPG', NULL, '2020-08-18 21:30:23', '2020-08-23 19:07:05', '30000.00'),
(7, 'Banten Pula Gembal', '(BANTEN PULA GEMBAL)\r\nBanten yang terdiri dari : Satu Soroh Suci, Pula Gembal dengan tatakannya, Tempeh Masrobong, Paso Masrobong, Papletikan, Sayut Banten, Dapetan, Peras, Penyeneng, Soda, Tipat Kelanan, Sasayut Langgeng Amukti Sakti, Sasayut Guru Asih, Tebasan Bagia Satata, Sasayut Sida Karya, Sasayut Kusuma Dewa, Sasayut Merta Utama, Sasayut Tirtha Merta Sari, Banten Guru, Udel, Kurenan, Pangapit, Pengiring, Ancak, Bingiin, Ungang, Tagog, Bulakan, Pancoran, Pengebek, Satu Soroh Penyeneng Gede, Satu Jrimpen, Satu Soroh Lis Senjata, Eteh - Eteh Pebersihan, Prayascita, Gebogan Jajan Kering, Gebogan Janjan Basah, Satu Dulang Jajan Saserodan, Satu Pajeg Rayunan Lengkap, Ulam Banten, Segehan Lengkap, Canang, Bunga, Kawangen, Asep, Dupa dan Toya Anyar.', 3, 'images/20200819115151_IMG_0061.JPG', NULL, '2020-08-18 21:39:18', '2020-08-23 19:06:09', '3000000.00'),
(8, 'Banten Prayascita', '(BANTEN PRAYASCITA)\r\nBanten yang jejahitannya menggunakan janur kelapa gading, alasnya memakai kulit sesayut, kulit peras bundar, daun tabia bun, nasi bundar, telur dadar, siung kasuna, jejahitan kukun kambing, raka - raka, rarasmen, sampian naga sari berisi plawa, porosan, bunga, dan rampe.', 4, 'images/20200819114212_IMG_0029.JPG', NULL, '2020-08-18 21:50:06', '2020-08-23 19:07:34', '30000.00'),
(9, 'Banten Peras Pengambian', '(BANTEN PERAS PENGAMBIAN)\r\nBanten yang alasnya memakai taledan, ditempelin kulit peras diisi tatukon, 2 buah tumpeng, raka - raka, rarasmen, sampian matangga, plawa, porosan, bunga, rampe, diantara tumpeng di letakan sebuah tipat pengambian, , tulung pengambian, sampian pengambian.', 5, 'images/20200819105937_IMG_9990.JPG', NULL, '2020-08-18 22:00:07', '2020-08-23 19:08:02', '1000000.00'),
(10, 'Banten Guru Penyeneng', '(BANTEN GURU PENYENENG)\r\nBanten yang terdiri dari : Dapetan, Peras, Pengambian, Penyeneng, Guru.', 6, 'images/20200819110358_IMG_0001.JPG', NULL, '2020-08-18 22:03:26', '2020-08-23 19:08:31', '1500000.00'),
(11, 'Banten Udel Kurenan', '(BANTEN UDEL KURENAN)\r\nBanteng yang terdiri dari : Dapetan, Peras, Pengambian, Penyeneng, Guru, Pengapit, Pengiring, Soda, Tipat Kelanan, dan Sasayut Tututan Banten.', 7, 'images/20200819110948_IMG_0008.JPG', NULL, '2020-08-18 22:09:52', '2020-08-23 19:09:00', '2000000.00'),
(12, 'Sampian Jrimpen Teterag', '(SAMPIAN JERIMPEN TETERAG)', 4, 'images/20200819105005_IMG_9966.JPG', NULL, '2020-08-18 22:15:35', '2020-08-23 19:09:24', '300000.00'),
(13, 'Banten Pengulapan', '(BANTEN PENGULAPAN)', 3, 'images/20200819114333_IMG_0036.JPG', NULL, '2020-08-18 22:16:15', '2020-08-23 19:09:46', '300000.00'),
(14, 'Sampian Gantung', '(SAMPIAN GANTUNG)', 5, 'images/Sampian Gantung.jpg', NULL, '2020-08-18 22:17:29', '2020-08-23 19:10:41', '60000.00'),
(15, 'Banten Guru Bendu Piduka', '(BANTEN GURU BENDU PIDUKA)', 2, 'images/Banten Guru Piduka.jpg', NULL, '2020-08-18 22:17:44', '2020-08-23 22:07:59', '1000000.00'),
(16, 'Banten Bebangkit', '(BANTEN BEBANGKIT)', 1, 'images/Bebangkit.JPG', NULL, '2020-08-18 22:19:07', '2020-08-23 19:11:34', '10000000.00');
