INSERT INTO `upakaras` (`id`, `name`, `description`, `sequence`, `created_at`, `updated_at`, `origin_image`) VALUES
(1, 'Dewa Yadnya', 'Upacara Dewa Yadnya merupakan pemujaan dan persembahyan sebagai wujud bakti kepada Ida Sang Hyang Widhi Wasa dan segala manifestasi-Nya.\r\nUpacara Dewa Yadnya umumnya dilaksanakan di Sanggah-sanggah, Pamerajan, Pura, Kayangan dan tempat suci lainnya. Upacara Dewa Yadnya ada yang dilakukan setiap hari dan ada juga yang dilakukan pada hari-hari tertentu. Contoh dari upacara Dewa Yadnya yang dilakukan setiap hari adalah puja tri sandya dan yadnya sesa. Sedangkan upacara Dewa Yadnya yang dilakukan pada hari-hari tertentu seperti Galungan, Kuningan, Saraswati, Siwaratri, Purnama dan Tilem, dan piodalan lainnya.', 1, '2020-08-02 22:57:41', '2021-01-10 22:02:34', 'images/Dewa Yadnya.jpg'),
(2, 'Manusa Yadnya', 'Upacara Manusa Yadnya merupakan korban suci yang bertujuan untuk memelihara hidup dan membersihkan lahir batin manusia mulai dari sejak terwujudnya jasmani di dalam kandungan sampai pada akhir hidup manusia itu.\r\nContoh upacara Manusa Yadnya ialah : upacara Pagedong-gedongan, upacara Bayi Lahir, upacara Kepus Puser, upacara Bayi umur 42 hari, upacara Nyambutin, upacara Satu Oton, upacara Meningkat Dewasa, Upacara Potong Gigi, Upacara Perkawinan.', 1, '2020-08-02 22:58:00', '2021-01-10 22:14:27', 'images/Manusa Yadnya.jpeg'),
(3, 'Bhuta Yadnya', 'Upacara Bhuta Yadnya merupakan yadnya yang ditujukan kepada Bhuta Kala yang mengganggu ketentraman hidup manusia. Bagi masyarakat Hindu, Bhuta Kala ini diyakini sebagai kekuatan - kekuatan yang bersifat negatif yang sering menimbulkan gangguan serta bencana tetapi dengan Bhuta Yadnya ini maka kekuatan - kekuatan tersebut akan dapat menolong dan melindungi kehidupan manusia.\r\nContoh Bhuta Yadnya ialah : Tingkatan kecil ( \"Segehan\" ), Tingkatan Sedang/Madya (\"Caru\"), Tingkatan Besar/Utama (\"Tawur Agung Kesanga, Nyepi, Eka Dasa Rudra\").', 2, '2020-08-18 22:23:41', '2021-01-10 22:27:50', 'images/Bhuta Yadnya.jpg'),
(4, 'Pitra Yadnya', 'Upakara Pitra Yadnya merupakan pemujaan dengan hati yang tulus iklas dan suci yang di tujukan kepada para pitara dan roh - roh leluhur yang telah meninggal dunia.\r\nContoh Pitra Yadnya ialah : Upacara Penguburan Mayat, Upacara Ngaben ( Sawa Wedana, Asti Wedana, Swast Wedana, Ngelungah, Atma Wedana ).', 2, '2020-08-18 22:24:22', '2021-01-10 22:36:48', 'images/ngaben.jpg'),
(5, 'Rsi Yadnya', 'Upakara Rsi Yadnya merupakan sedekah atau punia, juga persembahan kepada para pendeta atau para pemimpin upacara keagamaan. Tujuannya adalah sebagai tanda terimakasih kedapa para pendeta karena beliau telah menyelesaikan upacara yadnya.\r\nContoh Rsi Yadnya ialah : Padiksan utawi Apodgala.', 1, '2020-08-18 22:24:49', '2021-01-10 22:45:45', 'images/Rsi Yadnya.jpg');
